description:
Links (2008)  

Nederland
Drama / Komedie
80 minuten

geregisseerd door Froukje Tan
met Jeroen van Koningsbrugge en Lotte Verbeek

Dexters geregelde leven wordt verstoord wanneer er een meisje op zijn werk verschijnt dat sprekend lijkt op zijn vriendin Stella. Zijn leven raakt steeds verder ontregeld: hij wordt verdreven van zijn vertrouwde werkplek, Stella maakt het uit en zijn baas stuurt hem met onmiddellijke ingang met verlof. Als Dexter een aantal auto's heeft geramd, wordt hij gearresteerd door de politie en afgevoerd naar het ziekenhuis. Daar wordt duidelijk wat er met hem aan de hand is. Ondanks - of juist dankzij - zijn afwijking leert hij een andere kant van zichzelf kennen, die hem uiteindelijk in staat stelt contact te maken met zijn gevoelsleven.

